import React from 'react';

import {
  Container,
  Title,
  Wrapper,
  InfoContainer,
  WorldIcon,
  UsersIcon,
  LanguagesIcon,
  InfoDescription,
  InfoTitle,
  EuropeContainer,
  EuropeImage,
} from './styles';

const SessionFour: React.FC = () => {
  return (
    <Container>
      <Title>Where is toSupply at?</Title>
      <Wrapper>
        <InfoContainer>
          <WorldIcon />
          <InfoTitle>More than 10 countries</InfoTitle>
          <InfoDescription />
        </InfoContainer>
      </Wrapper>
      <EuropeContainer>
        <EuropeImage />
      </EuropeContainer>
    </Container>
  );
};

export default SessionFour;
